var debug;
var log;

/**
 * Companion instance icons class for Shure Wireless.
 * Utilized to generate/recall the icons for realtime monitoring.
 *
 * @version 1.0.0
 * @since 1.0.0
 * @author Keith Rocheck <keith.rocheck@gmail.com>
 */
class instance_icons {

	/**
	 * Create an instance of a Shure icons module.
	 *
	 * @param {instance} instance - the parent instance
	 * @since 1.0.0
	 */
	constructor(instance) {
		this.instance = instance;
		this.Image    = instance.Image;
		this.rgb      = instance.rgb;

		this.savedIcons = {};

		this.AD_ANT = {
			BB: '',
			BR: '',
			BX: '',
			RB: '',
			RR: '',
			RX: '',
			XB: '',
			XR: '',
			XX: ''
		};
		this.AD_AUDIO = {
			0:   '',
			1:   '',
			3:   '',
			7:   '',
			15:  '',
			31:  '',
			63:  '',
			127: '',
			128: '',
			129: '',
			131: '',
			135: '',
			143: '',
			159: '',
			191: '',
			255: ''
		};
		this.AD_RF = {
			0:  '',
			1:  '',
			3:  '',
			7:  '',
			15: '',
			31: '',
			32: '',
			33: '',
			35: '',
			39: '',
			47: '',
			63: ''
		};
		this.BATTERY= {
			0:   '',
			1:   '',
			2:   '',
			3:   '',
			4:   '',
			5:   '',
			255: ''
		};
		this.LOCK = {
			ALL:   '',
			MENU:  '',
			POWER: ''
		};
		this.ULX_ANT = {
			AX: '',
			XB: '',
			XX: ''
		};
		this.ULX_AUDIO = {
			0: '',
			1: '',
			2: '',
			3: '',
			4: '',
			5: '',
			6: ''
		};
		this.ULX_RF = {
			0: '',
			1: '',
			2: '',
			3: '',
			4: '',
			5: ''
		};
	}

	/**
	 * Returns the desired channel state object.
	 *
	 * @param {String} bg - the background color
	 * @param {String} ant - the antenna status
	 * @param {number} audio - the audio status
	 * @param {number} rfA - the RF A status
	 * @param {number} rfB - the RF B status
	 * @param {number|String} battery - the battery status
	 * @param {String} lock - the lock status
	 * @returns {String} base64 encoded PNG
	 * @access public
	 * @since 1.0.0
	 */
	getADStatus(bg = 0, ant = 'XX', audio = 0, rfA = 0, rfB = 0, battery = 255, lock = 'OFF') {
		var id = bg + '-' + ant + '-' + audio + '-' + rfA + '-' + rfB + '-' + battery + '-' + lock;
		var out;

		if ( this.savedIcons[id] === 'undefined' ) {
			var img = new this.Image();
			img.backgroundColor(bg);

			img.drawPixelBuffer(51, 13, 11, 10, this.AD_ANT[ant], 'base64');
			img.drawPixelBuffer(64, 13, 4, 42, this.AD_AUDIO[audio], 'base64');
			img.drawPixelBuffer(51, 24, 4, 31, this.AD_RF[rfA], 'base64');
			img.drawPixelBuffer(57, 24, 4, 31, this.AD_RF[rfB], 'base64');
			img.drawPixelBuffer(3, 46, 25, 9, this.BATTERY[battery], 'base64');

			if ( lock == 'ALL' || lock == 'POWER' || lock == 'MENU' ) {
				img.drawPixelBuffer(31, 46, 18, 8, this.LOCK[lock], 'base64');
			}

			out = img.toBase64();
		}
		else {
			out = this.savedIcons[id];
		}

		return out;
	}

	/**
	 * Returns the desired channel state object.
	 *
	 * @param {String} bg - the background color
	 * @param {String} ant - the antenna status
	 * @param {number} audio - the audio status
	 * @param {number} rf - the RF status
	 * @param {number|String} battery - the battery status
	 * @param {String} lock - the lock status
	 * @returns {String} base64 encoded PNG
	 * @access public
	 * @since 1.0.0
	 */
	getULXStatus(bg, ant = 'XX', audio = 0, rf = 0, battery = 255, lock = 'OFF') {
		var id = bg + '-' + ant + '-' + audio + '-' + rf + '-' + battery + '-' + lock;
		var out;

		//if ( this.savedIcons[id] === 'undefined' ) {
			var img = new this.Image();
			img.backgroundColor(bg);

			img.drawPixelBuffer(47, 12, 13, 5, this.ULX_ANT[ant], 'base64');
			img.drawPixelBuffer(63, 12, 5, 43, this.ULX_AUDIO[audio], 'base64');
			img.drawPixelBuffer(50, 19, 6, 37, this.ULX_RF[rf], 'base64');
			img.drawPixelBuffer(3, 46, 25, 9, this.BATTERY[battery], 'base64');

			if ( lock == 'ALL' || lock == 'POWER' || lock == 'MENU' ) {
				img.drawPixelBuffer(31, 46, 18, 8, this.LOCK[lock], 'base64');
			}

		//	this.savedIcons[id] = img.toBase64();
			out = img.toBase64();//this.savedIcons[id];
		//}
		//else {
		//	out = this.savedIcons[id];
		//}

		return out;
	}
}

exports = module.exports = instance_icons;